import React, {
  Fragment,
  useContext,
  useEffect,
  useMemo,
  useState,
} from "react";
import { fetchSuperMasterData } from "../../../services/homeservices";
import {
  Box,
  Button,
  Dialog,
  DialogContent,
  Grid,
  Link,
  TextField,
  Typography,
} from "@mui/material";
import { BASE_URL } from "../../../../assets/constants";
import { updateData, uploadFile } from "../../../assets/reportingServices";
import html2pdf from "html2pdf.js";
import { useSnackbar } from "notistack";
import { ReportingContext } from "../../../global/context/context";
import GlobalDateLayout from "../../../../assets/globalDateLayout/globalDateLayout";
import dayjs from "dayjs";

const CreateVaccineCertificate = ({
  corpId = localStorage.getItem("CORP_ID_REPORTING"),
  open,
  setOpen,
  selectedEmployees,
}) => {
  const [vacinationDate, setVacinationDate] = useState(null);
  const [vaccineDetailsCol1, setVaccineDetailsCol1] = useState("");
  const [vaccineDetailsCol2, setVaccineDetailsCol2] = useState("");
  const { enqueueSnackbar } = useSnackbar();
  const [totalEmployees, setTotalEmployees] = useState(0);
  const [uploadedCount, setUploadedCount] = useState(0);

  const generatePDF = async (data) => {
    const vacinationCertificateHtml = `
    <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">
  <head>
    <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
    <title>9a80f1f4-38e4-408a-9720-061165f5f18f</title>
    <style type="text/css">
      * {
        margin: 2px;
        padding: 0;
        text-indent: 0;
      }
      .s1 {
        color: #3f3f3f;
        font-family: "Times New Roman", serif;
        font-style: normal;
        font-weight: normal;
        text-decoration: none;
        font-size: 13pt;
      }
      h1 {
        color: #127ddd;
        font-family: Arial, sans-serif;
        font-style: normal;
        font-weight: bold;
        text-decoration: none;
        font-size: 13pt;
      }
      .s2 {
        color: #127ddd;
        font-family: Arial, sans-serif;
        font-style: normal;
        font-weight: bold;
        text-decoration: underline;
        font-size: 13pt;
      }
      h2 {
        color: #3f3f3f;
        font-family: Arial, sans-serif;
        font-style: normal;
        font-weight: bold;
        text-decoration: none;
        font-size: 12pt;
      }
      .p,
      p {
        color: #3f3f3f;
        font-family: Arial, sans-serif;
        font-style: normal;
        font-weight: normal;
        text-decoration: none;
        font-size: 12pt;
        margin: 0pt;
      }
      .s3 {
        color: #3f3f3f;
        font-family: Arial, sans-serif;
        font-style: normal;
        font-weight: bold;
        text-decoration: none;
        font-size: 13pt;
      }
    </style>
  </head>
  <body>

<div>
<img 
style="width: 794pt;height: 100%;"
src="data:image/png;base64,"
/>
</div>
<div style="padding-inline: 20px;"> 
    <p style="text-indent: 0pt; text-align: left"><br /></p>
    <p class="s1" style="text-indent: 0pt; text-align: right">
      Date: ${dayjs(vacinationDate).format("D MMM YY")}
    </p>
    <p style="text-indent: 0pt; text-align: left"><br /></p>
    <h1 style="padding-left: 11pt; text-indent: 0pt; text-align: center">
      VACCINATION CERTIFICATE
    </h1>
    <p style="padding-top: 12pt; text-indent: 0pt; text-align: left"><br /></p>
    <p
      class="s1"
      style="padding-left: 57pt; text-indent: 0pt; text-align: left"
    >
      It is certified that Shri/Smt./Miss. ${data.name} has been vaccinated on
      date ${dayjs(vacinationDate).format("D MMM YY")}.
    </p>
    <p
      class="s2"
      style="
        padding-top: 11pt;
        padding-left: 27pt;
        text-indent: 0pt;
        text-align: justify;
      "
    >
      Vaccine Details
    </p>
   

    <div style="margin-left:30px;display:flex">

    <div style="width:200px"> <h2> <pre>${vaccineDetailsCol1}</pre> </h2> </div>
    <div> <pre>${vaccineDetailsCol2}</pre></div>

    </div>
  
</div> 
    <div>
    <img
    style="width: 794pt;height: 100%;"
    src="data:image/png;base64,"
    />
    </div>
  <div style="padding-inline: 20px;"> 
   <p
      class="s3"
      style="
        padding-top: 5pt;
        padding-left: 15pt;
        text-indent: 0pt;
        text-align: left;
      "
    >
      Dr Sign
    </p>
    </div>
  </body>
</html>

    `;
    const pdfBlob = await html2pdf()
      .from(vacinationCertificateHtml)
      .output("blob")
      .then((data) => {
        return data;
      });

    const formData = new FormData();
    formData.append("file", pdfBlob, `${data.empId}_VacinationCertificate.pdf`);

    const url =
      BASE_URL +
      `org/upload?empId=${data?.empId}&fileType=VACCINATION_CERTIFICATE&corpId=${corpId}&campCycleId=`;
    const result = await uploadFile(url, formData);
    if (result && result.data) {
      enqueueSnackbar("Successfully Uploaded PDF!", {
        variant: "success",
      });
      setUploadedCount((prevCount) => prevCount + 1);
    } else {
      enqueueSnackbar("An error Occurred!", {
        variant: "error",
      });
    }
  };

  const handleGeneratePDFs = async () => {
    for (let i = 0; i < selectedEmployees.length; i++) {
      await generatePDF(selectedEmployees[i]);
    }
  };
  const handleDeletePDF = async () => {
    for (let i = 0; i < selectedEmployees.length; i++) {
      await deleteFiles(selectedEmployees[i]);
    }
  };

  console.log({ selectedEmployees });

  const deleteFiles = async (data) => {
    const url =
      BASE_URL +
      `org/employee/delete/file?corpId=${corpId}&toDeletefiletype=VACCINATION_CERTIFICATE&empId=${data.empId}`;
    const result = await updateData(url);
    if (result && result.data) {
      enqueueSnackbar("Successfully Uploaded PDF!", {
        variant: "success",
      });
      setUploadedCount((prevCount) => prevCount + 1);
    } else {
      enqueueSnackbar("An error Occurred!", {
        variant: "error",
      });
    }
  };

  return (
    <Fragment>
      <Dialog
        open={open}
        onClose={() => setOpen(false)}
        maxWidth="lg"
        fullWidth
      >
        <DialogContent>
          <Box sx={{ p: 3, rowGap: 4 }}>
            <Grid container spacing={2}>
              <Grid item xs={12} lg={12}>
                <GlobalDateLayout
                  label={"Select Vaccination Date"}
                  initialDate={vacinationDate}
                  setDate={setVacinationDate}
                  disableFuture={true}
                />
              </Grid>
              <Grid item xs={12} lg={6}>
                <TextField
                  size="small"
                  fullWidth
                  label={`Add Vacination Details Column 1`}
                  placeholder={`Add Vacination Details Column 1`}
                  value={vaccineDetailsCol1 || ""}
                  onChange={(e) => {
                    setVaccineDetailsCol1(e.target.value);
                  }}
                  multiline
                  minRows={15}
                />
              </Grid>
              <Grid item xs={12} lg={6}>
                <TextField
                  size="small"
                  fullWidth
                  label={`Add Vacination Details COlumn 2`}
                  placeholder={`Add Vacination Details COlumn 2`}
                  value={vaccineDetailsCol2 || ""}
                  onChange={(e) => {
                    setVaccineDetailsCol2(e.target.value);
                  }}
                  multiline
                  minRows={15}
                />
              </Grid>

              <Grid item xs={12} lg={12}>
                <Button
                  variant="contained"
                  onClick={() => handleGeneratePDFs()}
                >
                  Start Generating
                </Button>
                <Button
                  sx={{ backgroundColor: "red", color: "#FFF" }}
                  variant="contained"
                  onClick={() => handleDeletePDF()}
                >
                  Delete Files
                </Button>
              </Grid>
              <Grid item xs={12} lg={12}>
                <Box>Total Selected Employees: {selectedEmployees.length}</Box>
              </Grid>
              <Grid item xs={12} lg={12}>
                <Box>Uploaded Files: {uploadedCount}</Box>
              </Grid>
              <Grid item xs={12} lg={12}>
                {selectedEmployees.map((item, index) => (
                  <Box key={index} style={{ display: "flex" }}>
                    <Box>
                      {item.empId} {item.name}
                    </Box>
                    <Link href={item.vaccinationCertificateUrl}>
                      <Typography key={index}>
                        {item.vaccinationCertificateUrl}
                      </Typography>
                    </Link>
                    <br />
                  </Box>
                ))}
              </Grid>
            </Grid>
          </Box>
        </DialogContent>
      </Dialog>
    </Fragment>
  );
};

export default CreateVaccineCertificate;
